from shiny import App, module, reactive, render, ui
from .modules import group_ui, group_server, ztest, chance_to_be_best
import pandas as pd
import numpy as np
from plotnine import ggplot, geom_line, labs, aes
from scipy.stats import norm, beta

POINT_CNT = 10000
XQ = 0.001
REP_CNT = 100000

app_ui = ui.page_fluid(
    ui.page_fluid(
        ui.row(
            ui.column(
                6,
                ui.input_radio_buttons(
                    "alternative", "alternative", 
                    {"greater": "greater", "less":"less", "two.sided": "two.sided"},
                    inline=True
                ),
            ),
            ui.column(
              5, 
              ui.input_numeric(
                "conf_level", label="置信水平", 
                value=0.95, min=0.0, max=1.0, step=0.05
              )
            )
        ),
        ui.row(
            ui.column(2, ""),
            ui.column(2, ui.tooltip("样本数", "count(1), 避免count(distinct distinct_id)")),
            ui.column(2, ui.tooltip("均值", "avg(coalesce(y, 0.0))")),
            ui.column(2, ui.tooltip("方差", "var_samp(coalesce(y, 0.0))")),
            ui.column(1, ui.tooltip("delta", "当前组均值 - 对照组")),
            ui.column(1, ui.tooltip("p", "p")),
            ui.column(2, ui.tooltip(f"CI", "CI")),
        ),
        ui.row(
            ui.column(2, "对照组0"), 
            ui.column(2, ui.input_numeric("n0", label=None, value=1020, step=1, min=0)),
            ui.column(2, ui.input_numeric("m0", label=None, value=0.50, step=0.01)),
            ui.column(2, ui.input_numeric("var0", label=None, value=None, step=0.01, min=0.0)),
        ),
        ui.output_ui("new_groups"), 
        ui.input_action_button("add", "新增"),
    ),
    ui.output_plot("density"),
)


def server(input, output, session):

    suff = reactive.value({})
    def update_suff(k, isuff):
        new = suff.get().copy()
        new[k] = isuff
        suff.set(new)

    next_gid = 1
    groups = reactive.value([next_gid])
    group_server(
        f"g{next_gid}", k=f"g{next_gid}", _update_suff=update_suff,
        n0=input.n0, m0=input.m0, var0=input.var0, 
        alternative=input.alternative, conf_level=input.conf_level
    )

    @reactive.effect
    @reactive.event(input.add)
    def _():
        next_gid = max(groups.get()) + 1
        groups.set(groups.get() + [next_gid])
        group_server(
            f"g{next_gid}", k=f"g{next_gid}", _update_suff=update_suff,
            n0=input.n0, m0=input.m0, var0=input.var0, 
            alternative=input.alternative, conf_level=input.conf_level
        )

    @output
    @render.plot
    def density():

        _suff = suff().copy()
        _suff['g0'] = [input.n0(), input.m0(), input.var0()]
        _suff = [v for (k, v) in sorted(_suff.items())]

        prob, is_bin, suff_para = chance_to_be_best(_suff, no_approx=True, rep_cnt=REP_CNT)

        if is_bin:
            x_lower = min([beta(a, b).ppf(XQ)  for (a, b) in suff_para])
            x_upper = max([beta(a, b).ppf(1 - XQ)  for (a, b) in suff_para])
        else:
            x_lower = min([norm(m, s).ppf(XQ)  for (m, s) in suff_para])
            x_upper = max([norm(m, s).ppf(1 - XQ)  for (m, s) in suff_para])
        x = np.arange(x_lower, x_upper, (x_upper - x_lower)/ POINT_CNT)
        y = np.concatenate(
            [beta(a, b).pdf(x) if is_bin else norm(a, b).pdf(x) for (a, b) in suff_para]  
        ) 
        pdf = pd.DataFrame({
            "x": np.tile(x, len(suff_para)),
            "g": np.repeat([f"g{i}" for i in range(0, len(suff_para))], POINT_CNT),
            "y": y 
        })
        title=", ".join([f"g{gi}: {p:.3f}" for (gi, p) in enumerate(prob)])
        title = "chance to be best " + title
        fig = (
            ggplot(pdf, aes(x="x", y="y", color="g")) + 
                geom_line() +
                labs(color="", x="", y="", title=title)
        )  
        return fig

    @output
    @render.ui
    def new_groups():
        return ui.TagList(
            *[group_ui(f"g{i}", group_id=f"实验组{i}") for i in groups.get() if i &gt; 0],
        )

app = App(app_ui, server)


