from shiny import App, module, reactive, render, ui
import numpy as np
from scipy.stats import norm

@module.ui
def group_ui(group_id):
    return ui.row(
        ui.column(2, f"{group_id}"), 
        ui.column(2, ui.input_numeric("n", label=None, value=1000, step=1, min=0)),
        ui.column(2, ui.input_numeric("m", label=None, value=0.51, step=0.01)),
        ui.column(2, ui.input_numeric("var", label=None, value=None, step=0.01, min=0.0)),
        ui.column(1, ui.output_code(f"delta")),
        ui.column(1, ui.output_code(f"p")),
        ui.column(2, ui.output_code(f"ci")),
    )

@module.server
def group_server(
    input, output, session, n0, m0, var0, 
    k, _update_suff, 
    alternative, conf_level
):

    @reactive.effect
    @reactive.event(input.n, input.m, input.var)
    def update_suff():
        _update_suff(k, [input.n(), input.m(), input.var()])

    @render.code
    def delta():
        return f"{(input.m() - m0()):.3f}"

    @render.code
    def p():
        _p = ztest(
          n0(), m0(), var0(), 
          input.n(), input.m(), input.var(), True, 
          alternative(), conf_level()
        )[2]
        return f"{_p:.3f}"

    @render.code
    def ci():
        _ci = ztest(
          n0(), m0(), var0(), 
          input.n(), input.m(), input.var(), True,
          alternative(), conf_level()
        )[4]
        return f"{_ci[0]:.3f} ~ {_ci[1]:.3f}"

def ztest(
  n0, m0, var0, n1, m1, var1,
  no_approx=True, alternative="greater", conf_level=0.95
):
  delta = m1 - m0
  if is_binomial(n0, m0, var0) and no_approx:
    p = (n0 * m0 + n1 * m1) / (n0 + n1)
    stderr = float(np.sqrt(p * (1.0 - p) * (1 / n0 + 1 / n1)))
  else:
    stderr = float(np.sqrt(var0 / n0 + var1 / n1))

  if alternative == "two.sided":
      p = norm.cdf(-abs(delta / stderr)) * 2
      alternative_s = "备择假设：实验组和对照组的均值有差异"
      lower = float(delta - norm.ppf((0.5 - conf_level / 2)) * stderr)
      upper = float(delta + norm.ppf((0.5 + conf_level / 2)) * stderr)
  elif alternative == "greater":
      alternative_s = "备择假设：实验组均值大于对照组的均值"
      p = 1.0 - norm.cdf(delta / stderr)
      lower = float(delta - norm.ppf(conf_level) * stderr)
      upper = float("inf")
  else:
      alternative_s = "备择假设：实验组均值小于对照组的均值"
      p = norm.cdf(delta / stderr)
      lower = float("-inf")
      upper = float(delta + norm.ppf(conf_level) * stderr)
  ctw = 1 - norm.cdf(0, delta, stderr)
  return (delta, stderr, float(p), float(ctw), [lower, upper], alternative_s)

def is_binomial(n0, m0, var0):
    if m0 &lt;= 0.0 or m0 &gt;= 1.0:
        return False
    if (var0 is None or var0 &lt;= 0.0):
        return True
    q = (1 - m0) 
    return m0 * (1 - m0) == var0 or m0 * (1 - m0) * n0 / (n0 - 1) == var0

def chance_to_be_best(suff, rep_cnt=100000, no_approx=True):
    (n0, m0, var0) = suff[0]
    suff_para = []
    if is_binomial(n0, m0, var0) and no_approx:
        rng_samples = []
        for isuff in suff:
            (n, p, var) = isuff
            alpha = int(np.round(n * p))
            beta = n - alpha
            rng_samples.append(np.random.beta(alpha, beta, rep_cnt))
            suff_para.append([alpha, beta])
        prob = np.bincount(np.vstack(rng_samples).argmax(axis=0)) / rep_cnt
        if prob.shape[0] &lt; len(suff):
            prob = np.concatenate([prob, np.zeros(len(suff) - prob.shape[0])])

        return (prob, no_approx, suff_para)

    if len(suff) == 2:
        (n0, m0, var0) = suff[0]
        (n1, m1, var1) = suff[1]

        delta = float(m1 - m0)
        stderr = float(np.sqrt(var0 / n0 + var1 / n1))
        ctw = 1 - norm.cdf(0, delta, stderr)
        prob = np.array([1 - ctw, ctw])
        suff_para = [
            [m0, float(np.sqrt(var0 / n0))], 
            [m1, float(np.sqrt(var1 / n1))]
        ]
        return (prob, False, suff_para)

    rng_samples = []
    for isuff in suff:
        (n, m, var) = isuff
        rng_samples.append(np.random.normal(m, np.sqrt(var / n), rep_cnt))
        suff_para.append([m, float(np.sqrt(var / n))])

    prob = np.bincount(np.vstack(rng_samples).argmax(axis=0)) / rep_cnt
    if prob.shape[0] &lt; len(suff):
        prob = np.concatenate([prob, np.zeros(len(suff) - prob.shape[0])])

    return (prob, False, suff_para)

